const StrongSubTitle = ({content}) => {
    return(
        <strong className="subtitle-Allstudy">{content}</strong>
    )
}
const StrongTextTitle = ({content}) => {
    return(
        <strong className="text-title-Allstudy">Allstudy</strong>
    )
}
export {
    StrongSubTitle, StrongTextTitle
}
